Julianne Hough - 
This was a very random and cool moment, at the last minute I got tickets to the CMA Fest in Nashville in 2009 and I saw her and Immediately took this picture. I really loved her music and really enjoyed this moment. 
@juleshough

@dey_bass - 
She is one of the most dynamic and amazing bassists of her generation! I’m so grateful I got to see her live and photograph her! 

